        <Route exact path='/' element={<div className='container'><Gasolina95/></div>}/>
        <Route path='/gasoleo' element={<div className='container-md mt-4'><Gasoleo/></div>}/>
        <Route exact path='/gasolina98' element={<div className='container-md mt-4'><Gasolina98/></div>}/>
      </Routes>
      </div>
      <Fecha/>
    </Router>

  );
}

export default App;
